import React from "react";
import "./Table.css";
import "./functionality/ToolTip.css";
import ToolTip from "./functionality/ToolTip";

const ChapterContent = ({ subTopicData }) => {
  // Extract levels from subTopicData
  const { Basic, Intermediate, Advanced, NPTEL, LiveVideo } = subTopicData.levels || {};

  return (
    <div className="chapter-content">
      {/* Rendering Basic Level */}
      {Basic && Basic.length > 0 && (
        <div className="content-level">
          <h4>Basic Level</h4>
          <ul>
            {Basic.map((item, index) => (
              <li key={index} className="content-item">
                <h5>{item.title || "No Title Available"}</h5>
                <p>{item.description || "No Description Available"}</p>
                {item.link && (
                  <a href={item.link} target="_blank" rel="noopener noreferrer">
                    Read More
                  </a>
                )}
                <p>Rating: {item.rating || "N/A"}/5</p>
              </li>
            ))}
          </ul>
        </div>
      )}

      {/* Rendering Intermediate Level */}
      {Intermediate && Intermediate.length > 0 && (
        <div className="content-level">
          <h4>Intermediate Level</h4>
          <ul>
            {Intermediate.map((item, index) => (
              <li key={index} className="content-item">
                <h5>{item.title || "No Title Available"}</h5>
                <p>{item.description || "No Description Available"}</p>
                {item.link && (
                  <a href={item.link} target="_blank" rel="noopener noreferrer">
                    Read More
                  </a>
                )}
                <p>Rating: {item.rating || "N/A"}/5</p>
              </li>
            ))}
          </ul>
        </div>
      )}

      {/* Rendering Advanced Level */}
      {Advanced && Advanced.length > 0 && (
        <div className="content-level">
          <h4>Advanced Level</h4>
          <ul>
            {Advanced.map((item, index) => (
              <li key={index} className="content-item">
                <h5>{item.title || "No Title Available"}</h5>
                <p>{item.description || "No Description Available"}</p>
                {item.link && (
                  <a href={item.link} target="_blank" rel="noopener noreferrer">
                    Read More
                  </a>
                )}
                <p>Rating: {item.rating || "N/A"}/5</p>
              </li>
            ))}
          </ul>
        </div>
      )}

      {/* Rendering NPTEL Level */}
      {NPTEL && NPTEL.length > 0 && (
        <div className="content-level">
          <h4>Local NPTEL</h4>
          <ul>
            {NPTEL.map((item, index) => (
              <li key={index} className="content-item">
                <h5>{item.title || "No Title Available"}</h5>
                <p>{item.description || "No Description Available"}</p>
                {item.link && (
                  <a href={item.link} target="_blank" rel="noopener noreferrer">
                    Read More
                  </a>
                )}
                <p>Rating: {item.rating || "N/A"}/5</p>
              </li>
            ))}
          </ul>
        </div>
      )}

      {/* Rendering Live Video Level */}
      {LiveVideo && LiveVideo.length > 0 && (
        <div className="content-level">
          <h4>Live Video</h4>
          <ul>
            {LiveVideo.map((item, index) => (
              <li key={index} className="content-item">
                <h5>{item.title || "No Title Available"}</h5>
                <p>{item.description || "No Description Available"}</p>
                {item.link && (
                  <a href={item.link} target="_blank" rel="noopener noreferrer">
                    Read More
                  </a>
                )}
                <p>Rating: {item.rating || "N/A"}/5</p>
              </li>
            ))}
          </ul>
        </div>
      )}
    </div>
  );
};

export default ChapterContent;
